	static public void base64tojpg() {
		//String imgString="";
		/**
		 * 照片大小为：0.0018310546875M
suffix: jpeg
照片宽为：293px
照片高为：293px
文件宽高不符合要求
		 */
		//String imgString="";
		/**
		 * 照片大小为：0.04848194122314453M
		 * suffix: jpeg
照片宽为：600px
照片高为：226px
文件宽高不符合要求
		 */
		String imgString="";
		/**
		 * 照片大小为：0.0018339157104492188M
照片宽为：293px
照片高为：293px
文件宽高不符合要求
suffix: jpeg
		 */
		//允许的图片格式（可配置）
		String imgType = "jpg,png,jpeg";
		try {
			imgString = replacePre(imgString);
			//BASE64Decoder decoder = new BASE64Decoder();
			byte[] bytes = new BASE64Decoder().decodeBuffer(imgString);
			//判断文件大小是否符合要求
			if (!checkSize(bytes)) {
				//throw new BizException(ErrorMessage.ERROR_FILE_FORMAT.getCode(), "文件大小不符合要求");
				System.out.println("文件大小不符合要求");
			}

			//不带类似data:image/jpg;base64,前缀的解析
			ImageInputStream imageInputstream = new MemoryCacheImageInputStream(new ByteArrayInputStream(
					bytes));
			//不使用磁盘缓存
			ImageIO.setUseCache(false);
			Iterator<ImageReader> it = ImageIO.getImageReaders(imageInputstream);
			if (it.hasNext()) {
				ImageReader imageReader = it.next();
				// 设置解码器的输入流
				imageReader.setInput(imageInputstream, true, true);

				// 图像文件格式后缀
				String suffix = imageReader.getFormatName().trim().toLowerCase();
				int height = imageReader.getHeight(0);
				int width = imageReader.getWidth(0);
				imageInputstream.close();
				//校验宽和高是否符合要求
				if (!checkWidthAndHeight(width, height)) {
					//throw new BizException(ErrorMessage.ERROR_FILE_FORMAT.getCode(), "文件宽高不符合要求");
					System.out.println("文件宽高不符合要求");
				}
				String[] imgTypes = imgType.split(",");
				for (String type : imgTypes) {
					if (type.equalsIgnoreCase(suffix)) {
						System.out.println("suffix: "+suffix);
					}
				}
			}

		} catch (IOException e) {
			e.printStackTrace();
			//throw new BizException(ErrorMessage.SYSTEM_ERROR.getCode(), ErrorMessage.SYSTEM_ERROR.getMessage());
		}


		//BufferedImage bufImg = ImageIO.read(new ByteArrayInputStream(new BASE64Decoder().decodeBuffer(base64Str)));
		//System.out.println(bufImg);
	}

	/**
	 * 校验宽高
	 *
	 * @param 
	 * @return
	 */
	static public boolean checkWidthAndHeight(int width, int height) {
		//宽高最小值（可配置） 单位px
		int imgRangeLow = 8;
		//宽高最大值（可配置） 单位px
		int imgRangeHigh = 40;
		System.out.println("照片宽为：" + width + "px");
		System.out.println("照片高为：" + height + "px");

		if (width > imgRangeLow && width <= imgRangeHigh &&
				height > imgRangeLow && height <= imgRangeHigh) {
			return true;
		}

		return false;
	}

	/**
	 * 去掉base64图片前缀
	 *
	 * @param imgString
	 * @return
	 */
	static public String replacePre(String imgString) {
		//允许的图片格式（可配置）
		String imgType = "jpg,png,jpeg";
		if (true) {//!StringUtils.isEmpty(imgType)) {
			String[] imgTypes = imgType.split(",");
			Pattern pattern;
			Matcher matcher;
			String regex;
			for (String v : imgTypes) {
				regex = MessageFormat.format("data:image/{0};base64,", v);
				pattern = Pattern.compile(regex, Pattern.CASE_INSENSITIVE);
				matcher = pattern.matcher(imgString);
				if (matcher.lookingAt()) {
					return matcher.replaceFirst("");
				}
			}
		}
		return imgString;
	}

	/**
	 * 校验文件大小
	 *
	 * @param
	 * @return
	 */
	static public boolean checkSize(byte[] bytes) {
		//符合条件的照片大小（可配置） 单位：M
		double imgSize = 0.0018310546875;
		//图片转base64字符串一般会大，这个变量就是设置偏移量。可配置在文件中，随时修改。目前配的是0。后续看情况适当做修改
		double deviation = 0.0;
		int length = bytes.length;
		//原照片大小
		double size = (double) length / 1024 / 1024 * (1 - deviation);
		System.out.println("照片大小为：" + size + "M");
		return size > imgSize;
	}

